Запрос к БД (SELECT) sale.ticket_name, COUNT(*) AS n_sales FROM sale 
WHERE sale.date BETWEEN 'start_date' AND 'end_date' 
GROUP BY sale.ticket_id ORDER BY n_sales DESC;

